          "text": "<div id=\"pg-1067-0\" class=\"panel-grid panel-no-style\" style=\"border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px 0px 35px; outline: 0px; padding: 0px; vertical-align: baseline; display: flex; flex-wrap: nowrap; justify-content: space-between; align-items: flex-start;\"><div id=\"pgc-1067-0-0\" class=\"panel-grid-cell\" style=\"border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; width: calc(100% - 0px);\"><div id=\"panel-1067-0-0-2\" class=\"so-panel widget widget_sow-editor panel-last-child\" data-index=\"2\" style=\"border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; zoom: 1;\"><div class=\"so-widget-sow-editor so-widget-sow-editor-base\" style=\"border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\"><div class=\"siteorigin-widget-tinymce textwidget\" style=\"border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\"><p style=\"border: 0px; font-size: 13px; outline: 0px; vertical-align: baseline; text-align: justify;\"><font style=\"vertical-align: inherit;\"><font style=\"vertical-align: inherit;\"><font style=\"vertical-align: inherit;\"><font style=\"vertical-align: inherit;\">O Museu do Doce da Universidade Federal de Pelotas - situado na Praça Coronel Pedro Osório, número 8 - foi criado em 30 de dezembro de 2011.</font></font></font></font></p><p style=\"border: 0px; font-size: 13px; outline: 0px; vertical-align: baseline; text-align: justify;\"><font style=\"vertical-align: inherit;\"><font style=\"vertical-align: inherit;\"></font></font><br><font style=\"vertical-align: inherit;\"><font style=\"vertical-align: inherit;\">Configura-se como órgão suplementar do Instituto de Ciências Humanas da UFPel e tem como missão salvaguardar os suportes de memória da tradição doceira de Pelotas e da região e como compromisso, produzir conhecimento sobre esse patrimônio.</font></font></p><p style=\"border: 0px; font-size: 13px; outline: 0px; vertical-align: baseline; text-align: justify;\"><br><font style=\"vertical-align: inherit;\"><font style=\"vertical-align: inherit;\">A casa histórica que sedia o Museu do Doce foi construída em 1878 a mando de Francisco Antunes Maciel, político pelotense que foi Conselheiro do Imperador. </font><font style=\"vertical-align: inherit;\">Em 1950, a família mudou-se para o Rio de Janeiro e alugou a casa para o uso do Comando da atual 8 Brigada de Infantaria Motorizada do Exército Brasileiro ”. </font><font style=\"vertical-align: inherit;\">Em 1977, a casa foi tombada em nível federal pelo Iphan e comprada pela UFPel em 2006. Em 2010, a UFPel deu início ao processo de restauração e adequação das instalações para uso do Museu. </font><font style=\"vertical-align: inherit;\">Em 2013, o restauro foi concluído e o Museu do Doce instalou-se na casa.</font></font></p></div></div></div></div></div>"
